import React from 'react';


const propTypes = {};

const defaultProps = {};

const cardMain = {
    // backgroundColor: "rgb(0, 0, 0, 0.6)",
    backgroundColor: "red",
    width: "400px",
    height: "400px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-between"
}

const cardImg = {
    width: "100%",
    height: "100%",
    objectFit: "scale-down",
    margin: "0",
    padding: "0"
}



const ProjectCard = () => {
    return <div style={cardMain}>
        <img style={cardImg} src="netflixClone.png" />
        <div>
            <h3>Title</h3>
            <div>
                <p><strong>Description:</strong> A copy of a Netflix website with user
                sign-up and sign-in pages<br /> <strong>Technology: </strong> React, CSS, HTML, Javascript, Firebase</p>



            </div>

        </div>


    </div>;
}

ProjectCard.propTypes = propTypes;
ProjectCard.defaultProps = defaultProps;
// #endregion

export default ProjectCard;
